/************************************************************************************
* Name: muphone
* Purpose: User function to initialize the MuPhone
* Input(s): N/A
* Output: N/A
************************************************************************************/
void muphone(void)
{
    /* initialize device hardware to allow MuPhone to be "turned on" */
    muphone_init();     // call to statically defined helper function

    return;     // never reached
}

