/************************************************************************************
* Name: thread_muphone_home_screen
* Purpose: Thread to handle the MuPhone's home screen
* Input(s): N/A
* Output: N/A
************************************************************************************/
void thread_muphone_home_screen(void)
{
    // set current app
    phone.current_app = HOME_SCREEN;

    /* draw MuPhone home screen */
    LCD_DrawSection(section_muphone_home_screen,
                    (sizeof(section_muphone_home_screen)/sizeof(section_muphone_home_screen[0])));

    LCD_DrawSection(section_muphone_home_screen_applications,
                    (sizeof(section_muphone_home_screen_applications)/sizeof(section_muphone_home_screen_applications[0])));

    LCD_PrintTextSection(text_section_muphone_home_screen_applications,
                         (sizeof(text_section_muphone_home_screen_applications)/sizeof(text_section_muphone_home_screen_applications[0])));

    // re-enable P4 interrupts to allow touches to be made to LCD TP
    GPIO_enableInterrupt(GPIO_PORT_P4, GPIO_PIN0);

    /* add aperiodic thread to detect touches made to the home screen */
    G8RTOS_add_aperiodic_thread(aperiodic_muphone_home_screen, PORT4_IRQn, 6);

    // kill this thread (buh-bye)
    G8RTOS_kill_current_thread();

}

/************************************************************************************
* Name: thread_muphone_start_phone
* Purpose: Thread to handle one-time system initializations
* Input(s): N/A
* Output: N/A
************************************************************************************/
void thread_muphone_start_phone(void)
{
    /* draw MuPhone header bar */
    LCD_DrawSection(section_muphone_header_bar,
                    (sizeof(section_muphone_header_bar)/sizeof(section_muphone_header_bar[0])));


    /* print user's name in header bar */
    if (phone.self_contact == BRIT)
    {
        // local Text structure, used to print name in header bar
        Text text_section_header_name =
        {
         .xStart = MUPHONE_HEADER_BAR_NAME_BRIT_TEXT_X_START, .yStart = MUPHONE_HEADER_BAR_NAME_BRIT_TEXT_Y_START,
         .string = "Brit Chesley", .color = MUPHONE_HEADER_BAR_NOTIFICATION_TEXT_COLOR
        };

        // print name in header bar
        LCD_PrintTextStructure(text_section_header_name);
    }
    else if (phone.self_contact == CHRIS)
    {
        // local Text structure, used to print name in header bar
        Text text_section_header_name =
        {
         .xStart = MUPHONE_HEADER_BAR_NAME_CHRIS_TEXT_X_START, .yStart = MUPHONE_HEADER_BAR_NAME_CHRIS_TEXT_Y_START,
         .string = "Chris Crary", .color = MUPHONE_HEADER_BAR_NOTIFICATION_TEXT_COLOR
        };

        // print name in header bar
        LCD_PrintTextStructure(text_section_header_name);
    }

    /* enable "home screen button" (bottom daughter board button) */
    GPIO_enableInterrupt(GPIO_PORT_P5, GPIO_PIN4);
    G8RTOS_add_aperiodic_thread(aperiodic_muphone_home_button, PORT5_IRQn, 6);


    /* display home screen for first time */
     G8RTOS_add_thread(thread_muphone_home_screen, 60, "muphone - home screen");

    // "thread is dead, baby" - Bruce Willis, Pulp Fiction
    G8RTOS_kill_current_thread();


}

